import React from 'react';

function CV() {
  return (
    <section id="cv">
    <h2>Mon CV</h2>
    <p>Vous pouvez consulter mon CV en ligne ou le télécharger ci-dessous :</p>
    <embed id="pdf" src="CV_BARBOSA_Mathias.pdf" width="800" height="500" type="application/pdf"></embed>
        <ul>
            <li><a href="lien_vers_votre_cv_en_pdf.pdf" target="_blank">Voir mon CV (PDF)</a></li>
        </ul>
    </section>
  );
}

export default CV;
